    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Driftless Area NWR for the next 15 years. This
    plan outlines the Refuge vision and purpose and describes how Driftless Area NWR
    will contribute to the overall mission of the Refuge System. The plan provides an
    introduction to the Refuge, an overview of the CCP process, information on the Refuge
    environment and the management direction, and strategies for plan implementation.
    Key planning issues include: habitat management, visitor services, Refuge expansion,
    and species assessment.",nt"license_title": "License Not Specified",nt"extras":
